// Function to generate a random number between min and max (inclusive)
const getRandomNumber = function (min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

// Function to generate a random boolean value
const getRandomBoolean = function () {
  return Math.random() < 0.5;
}

// Function to generate a random object for the access property
const getRandomAccess = function () {
  return {
    mortgage: { status: getRandomBoolean() },
    insurance: { status: getRandomBoolean() },
    banking: { status: getRandomBoolean() },
    broadband: { status: getRandomBoolean() },
    mobile: { status: getRandomBoolean() },
    utilities: { status: getRandomBoolean() },
    auto: { status: getRandomBoolean() }
  };
}

export default {



  getLeads() {
    // Generate the array of 50 objects
    let array = [];
    for (let i = 0; i < 50; i++) {
      let obj = {
        id: getRandomNumber(100000, 999999),
        match: getRandomNumber(30, 99),
        value: getRandomNumber(5, 4000),
        selected: false,
        access: getRandomAccess(),
        status: getRandomBoolean()
      };
      array.push(obj);
    }
    console.log(array); // Print the array to the console
    return array
  }
}
